n&amp;action=edit&amp;section=1" title="Edit section: Sports and games, and general uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Running" title="Running">Running</a>, moving swiftly on foot</li> <li><a href="/wiki/Run_(American_football)" class="mw-redirect" title="Run (American football)">Run (American football)</a>, an offensive action in American football</li> <li><a href="/wiki/Run_(baseball)" title="Run (baseball)">Run (baseball)</a>, the unit of scoring in baseball</li> <li>Run, in <a href="/wiki/Glossary_of_basketball_terms#R" title="Glossary of basketball terms">basketball terminology</a>, an interval in which one team heavily outscores the other</li> <li><a href="/wiki/Run_(cricket)" title="Run (cricket)">Run (cricket)</a>, the unit of scoring in cricket</li> <li>Run, the unit of <a href="/wiki/Softball#Scoring_runs" title="Softball">scoring in softball</a></li> <li>A variety of events in <a href="/wiki/Track_and_field" title="Track and field">track and field</a></li> <li><a href="/wiki/Run_(cards)" title="Run (cards)">Run (cards)</a>, a series of playing cards with consecutive values</li> <li><a href="/wiki/Piste" title="Piste">Piste</a> or ski run, a marked trail down a mountain for winter sports</li> <li>Run, in <a href="/wiki/Sailing#Running" title="Sailing">sailing</a>, to sail downwind</li> <li><a href="/wiki/Bank_run" title="Bank run">Bank run</a>, a mass withdrawal by many people of money from a bank</li> <li><a href="/wiki/Diarrhea" title="Diarrhea">Diarrhea</a> or "the runs", an intestinal disease</li> <li>Sheep run, early Australian term for a <a href="/wiki/Sheep_station#Terminology" title="Sheep station">sheep station</a> operated by squatters</li> <li>Run, a flash game series created by Joseph Cloutier</li> </ul> <h2><span class="mw-headline" id="Geography_and_topography">Geography and topography</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Run&amp;action=edit&amp;section=2" title="Edit section: Geography and topography">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Run_(waterfalls)" title="Run (waterfalls)">Run (waterfalls)</a>, the horizontal distance a waterfall flows</li> <li><a href="/wiki/Stream" title="Stream">Stream</a> or run, a flowing body of water</li> <li><a href="/wiki/Run_(island)" title="Run (island)">Run (island)</a>, one of the Banda Islands in Indonesia</li> <li><a href="/wiki/Run_(stream)" title="Run (stream)">Run (stream)</a>, a stream in the Dutch province of Noord-Brabant</li> </ul> <h2><span class="mw-headline" id="People">People</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Run&amp;action=edit&amp;section=3" title="Edit section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Run_(rapper)" class="mw-redirect" title="Run (rapper)">Run (rapper)</a>, Joseph Simmons, from the hip-hop group Run–D.M.C.</li> <li><a href="/wiki/Run_(music)" class="mw-redirect" title="Run (music)">Run (music)</a>, a musicology term for a short rapid series of notes</li> <li><a href="/wiki/Giacomo_Bufarini" title="Giacomo Bufarini">Giacomo Bufarini</a>, Italian artist based in London, UK</li> </ul> <h2><span class="mw-headline" id="R.U.N.">R.U.N.</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Run&amp;action=edit&amp;section=4" title="Edit section: R.U.N.">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Regional_Universities_Network" title="Regional Universities Network">Regional Universities Network</a> (RUN), a network of six universities primarily from Australia</li> <li><a href="/wiki/ACT_Airlines" class="mw-redirect" title="ACT Airlines">ACT Airlines</a> (ICAO code), a Turkey-based cargo airline</li> <li><a href="/wiki/Kirundi" title="Kirundi">Kirundi</a> (ISO 639-2 and -3 code), an African language</li> <li><a href="/wiki/Roland_Garros_Airport" title="Roland Garros Airport">Roland Garros Airport</a> (IATA code), Saint-Denis, Réunion</li> </ul> <h2><span class="mw-headline" id="Computers">Computers</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Run&amp;action=edit&amp;section=5" title="Edit section: Computers">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Execution_(computing)" title="Execution (computing)">Execution (computing)</a>, operation of a computer program <ul> <li><a href="/wiki/Run_command" title="Run command">Run command</a>, a command used to begin execution of a program</li> </ul> </li> <li><a href="/wiki/RUN_(magazine)" class="mw-redirect" title="RUN (magazine)"><i>RUN</i> (magazine)</a>, a computer magazine of the 1980s</li> <li>A <a href="/wiki/Sequence#Sequences_and_automata" title="Sequence">sequence</a> of something repeated, in computer coding <ul> <li>A run of a single value in <a href="/wiki/Run-length_encoding" title="Run-length encoding">run-length encoding</a></li> </ul> </li> </ul> <h2><span class="mw-headline" id="Entertainment">Entertainment</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Run&amp;action=edit&amp;section=6" title="Edit section: Entertainment">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Run_(1991_film)" title="Run (1991 film)"><i>Run</i> (1991 film)</a>, a U.S. action thriller</li> <li><a href="/w/index.php?title=Run_(1994_film)&amp;action=edit&amp;redlink=1" class="new" title="Run (1994 film) (page does not exist)"><i>Run</i> (1994 film)</a>, a Hong Kong film <a href="/wiki/Leon_Lai_filmography" class="mw-redirect" title="Leon Lai filmography">featuring Leon Lai</a></li> <li><a href="/wiki/Run_(2002_film)" title="Run (2002 film)"><i>Run</i> (2002